import React from "react";
import  ReactDOM  from "react-dom";

function getTime(){
    var hour = new Date().getHours();
    var min = new Date().getMinutes();
    var sec = new Date().getSeconds();

    setInterval(getTime,1000,()=>{
        console.log("chla");
    });

    return (hour+" : "+min+" : "+sec);
}


ReactDOM.render(
    <>
    <h1>{getTime()}</h1>
    </>,
    document.getElementById("root")
)
